import { Component, OnInit } from '@angular/core';
import { RouterOutlet } from '@angular/router';
import { MatIcon } from '@angular/material/icon';

@Component({
  selector: 'app-root',
  standalone: true,
  imports: [ RouterOutlet, MatIcon ],
  templateUrl: './app.component.html',
  styleUrl: './app.component.scss'
})

export class AppComponent implements OnInit {
  ngOnInit() {
  }
}
<div class="grid place-items-center h-screen bg-blue-50">
    <div class="flex">
        <button
                class="w-[161.4px] h-[60px] bg-[url('/assets/img/bg-container.png')] bg-no-repeat bg-center bg-cover text-3xl text-white font-medium flex-shrink-0"
        >1</button>

        <button
                class="w-[60px] h-[161.4px] bg-[url('/assets/img/bg-container-vertical.png')] bg-no-repeat bg-center bg-cover text-3xl text-white font-medium flex-shrink-0"
        >2</button>
    </div>
</div>
